import Attack from './Attack';

function AttackCard(props) {

	return (
	<div>
	<Attack hand = {'Rock'} attackNum = {0} {...props}/>
	<Attack hand = {'Paper'} attackNum = {1} {...props}/>
	<Attack hand = {'Scissors'} attackNum = {2} {...props}/>
	</div>
	);
};

export default AttackCard;
